import React, { Component } from 'react';
import Counter from './counter';

class Tempos extends Component {

    render() { 
        return (
        <div>
             <button onClick={() => this.props.onReset} style={{color : 'orange'}}>Reset</button>
            { this.props.tempos.map(tempo => <Counter key={tempo.id} onDelete={this.props.onDelete} onClick={this.props.onStepClick} tempo={tempo} >
                <h4>Title: {tempo.title}</h4> 
            </Counter>)}    
        </div>);
    }
}

export default Tempos;
